import React from 'react';
import { useState } from 'react/cjs/react.development';
import './index.css';
function App(){
    const [name,set]=useState();
    function Nav(){
        return (<>
            <div className='nav'>
                <h2>This is mine</h2>
            </div>
        </>);
    }
    const Click = (event)=> {
        set(event.target.value);
    };
    function Input(){
        return (<>
        <div>
        <h1>Hello {name}</h1>
        <input  type="text" placeholder="Enter the Name" value={name} onChange={Click}/>
        <button className='button'>Click Me</button>
        </div>
        </>);
    }
    return <>
        <Input/>
        <Nav/>
    </>
}

export default App;
